const styles = theme => ({
    root: {
        display: 'flex',
        // width: theme.spacing(105),
        marginBottom: theme.spacing(2),
        padding: theme.spacing(1),
        position: 'relative',
        width: '100%',
        maxWidth: 500,
    },
    content: {
        flexGrow: 1,
    },
    details: {
        display: 'flex',
        flexDirection: 'row',
        marginTop: theme.spacing(1),
    },
    detailsItem: {
        margin: theme.spacing(0, 2, 0, 0),
    },
    actions: {
        display: 'flex',
        flexDirection: 'row',
    }
})

export default styles;
